DROP DATABASE IF EXISTS IMDB;
CREATE DATABASE IMDB;
USE IMDB;

CREATE TABLE movie (
movie_id INT(6) AUTO_INCREMENT PRIMARY KEY,
movie_name VARCHAR(100),
production_year INT(6),
votes INT(6),
ranking INT(6),
rating FLOAT(12,3)
) ENGINE=INNODB;
 
CREATE TABLE movie_info(
movie_id INT(6) NOT NULL,
movie_genre_id INT(6) NOT NULL,
note TEXT
) ENGINE=INNODB;
 
CREATE TABLE movie_genre(
movie_genre_id INT(6) AUTO_INCREMENT PRIMARY KEY,
genre_name VARCHAR(50)
) ENGINE=INNODB;
 
CREATE TABLE person(
person_id INT(6) AUTO_INCREMENT PRIMARY KEY,
person_name VARCHAR(100),
gender VARCHAR(10)
) ENGINE=INNODB;
 
CREATE TABLE role(
person_id INT(6) NOT NULL,
movie_id INT(6) NOT NULL,
role_name VARCHAR(100),
role_type_id INT(6) NOT NULL
) ENGINE=INNODB;
 
CREATE TABLE role_type(
role_type_id INT(6) AUTO_INCREMENT PRIMARY KEY,
type_name VARCHAR(100)
) ENGINE=INNODB;

# FK
ALTER TABLE movie_info ADD CONSTRAINT fk_movie_id FOREIGN KEY (movie_id) REFERENCES movie(movie_id);
ALTER TABLE movie_info ADD CONSTRAINT fk_movie_genre_id FOREIGN KEY (movie_genre_id) REFERENCES movie_genre(movie_genre_id);
ALTER TABLE role ADD CONSTRAINT fk_person_id FOREIGN KEY (person_id) REFERENCES person(person_id);
ALTER TABLE role ADD CONSTRAINT fk_role_movie_id FOREIGN KEY (movie_id) REFERENCES movie(movie_id);
ALTER TABLE role ADD CONSTRAINT fk_role_type_id FOREIGN KEY (role_type_id) REFERENCES role_type(role_type_id);










